import React from 'react';
import styles from './PopularPosts.module.scss';

interface Post {
    title: string;
    location: string;
    participants: string;
    time: string;
    views: number;
    image: string;
    description: string;
}

const posts: Post[] = [
    {
        title: "7월 5일 같이 뚝섬 플로깅해요",
        location: "뚝섬",
        participants: "5명 모집",
        time: "오후 7시",
        views: 450,
        image: "https://via.placeholder.com/150",
        description: "안녕하세요, 환경을 사랑하는 커뮤니티 여러분! 다가오는 주말, 뚝섬에서 플로깅 이벤트가 열린다고 합니다..."
    },
    {
        title: "낙산공원 플로깅 후기",
        location: "낙산공원",
        participants: "모집 없음",
        time: "오전 10시",
        views: 450,
        image: "https://via.placeholder.com/150",
        description: "지난 주말, 저는 낙산공원에서 플로깅을 했습니다. 플로깅은 조깅을 하면서 동시에 쓰레기를 줍는 활동으로..."
    },
    {
        title: "같이 부산에서 플로깅 하실 분 구합니다!",
        location: "부산 해운대",
        participants: "3명 모집",
        time: "오후 4시",
        views: 450,
        image: "https://via.placeholder.com/150",
        description: "안녕하세요, 부산을 사랑하는 모든 분들! 부산의 아름다운 해변을 지키기 위해 특별한 이벤트를 준비했습니다..."
    },
    {
        title: "청계천 플로깅 하실분~!",
        location: "서울 청계천",
        participants: "1명 모집",
        time: "오후 8시",
        views: 450,
        image: "https://via.placeholder.com/150",
        description: "이른 아침, 청계천의 시원한 바람을 맞으며 산책도 하고 환경도 지킬 수 있는 플로깅에 참여하세요..."
    },
];

const PopularPosts: React.FC = () => {
    return (
        <section className={styles.popularPosts}>
            <h2>인기글</h2>
            {posts.map((post, index) => (
                <div className={styles.post} key={index}>
                    <img src={post.image} alt={post.title} />
                    <div className={styles.postDetails}>
                        <h3>{post.title}</h3>
                        <p>{post.location} | {post.participants} | {post.time}</p>
                        <p>{post.description}</p>
                        <span>{post.views} views</span>
                    </div>
                </div>
            ))}
        </section>
    );
};

export default PopularPosts;
